import React from 'react'
import styled from 'styled-components'


const ButtonStyled= styled.div`
display: inline-flex;
border: 1px solid white;
border-radius: .5em;
min-width: 128px;
padding: 1em;
box-sizing: border-radius;
justify-content: center;
`



export default function Button() {
    return (
        <ButtonStyled>
        button
        </ButtonStyled>
    )
}
